INSERT INTO `RESOURCES` VALUES ('0','Printer.Start',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<output>\n    <display animation=\"scroll\">\n        <line>\n            <text>Openbravo POS</text>\n        </line>\n        <line>\n            <text>   Welcome   </text>\n        </line>\n    </display>\n</output>\n'),('1','Printer.Ticket',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!-- \r\n    Openbravo POS is a point of sales application designed for touch screens.\r\n    Copyright (C) 2007-2009 Openbravo, S.L.\r\n    http://sourceforge.net/projects/openbravopos\r\n\r\n    This file is part of Openbravo POS.\r\n\r\n    Openbravo POS is free software: you can redistribute it and/or modify\r\n    it under the terms of the GNU General Public License as published by\r\n    the Free Software Foundation, either version 3 of the License, or\r\n    (at your option) any later version.\r\n\r\n    Openbravo POS is distributed in the hope that it will be useful,\r\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n    GNU General Public License for more details.\r\n\r\n    You should have received a copy of the GNU General Public License\r\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\r\n -->\r\n<output>\r\n    <display>\r\n        <line>\r\n            <text align=\"left\" length=\"10\">Total.</text>\r\n            <text align=\"right\" length=\"10\">${ticket.printTotal()}</text>\r\n        </line>\r\n        <line>\r\n           <text align=\"center\" length=\"20\">Thank you.</text>\r\n        </line>\r\n    </display>\r\n    <ticket>\r\n        <image>Printer.Ticket.Logo</image>\r\n        <line></line>\r\n        <line>\r\n            <text align=\"center\" length=\"42\">Openbravo POS is a point of sale</text>\r\n        </line>\r\n        <line>\r\n            <text align=\"center\" length=\"42\">designed for touch screens</text>\r\n        </line>\r\n        <line>\r\n            <text align=\"center\" length=\"42\">Copyright 2007-2008 Openbravo, S. L.</text>\r\n        </line>\r\n        <line></line>\r\n        #if (${ticket.ticketType} == 0)\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Receipt:</text>\r\n            <text>${ticket.printId()}</text>\r\n        </line>\r\n        #end\r\n        #if (${ticket.ticketType} == 1)\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Refund:</text>\r\n            <text>${ticket.printId()}</text>\r\n        </line>\r\n        #end\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Date:</text>\r\n            <text>${ticket.printDate()}</text>\r\n        </line>  \r\n         #if ($ticket.getCustomer())\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Customer:</text>\r\n            <text>${ticket.getCustomer().printName()}</text>\r\n        </line>      \r\n        <line>\r\n            <text align=\"left\" length=\"15\"></text>\r\n            <text>${ticket.getCustomer().printTaxid()}</text>\r\n        </line>  \r\n        #end\r\n        #if ($place != \"\")\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Table:</text>\r\n            <text>${place}</text>\r\n        </line>  \r\n        #end\r\n        <line></line>    \r\n        <line>\r\n            <text align =\"left\" length=\"17\">Item</text>\r\n            <text align =\"right\" length=\"10\">Price</text>\r\n            <text align =\"right\" length=\"5\"></text>\r\n            <text align =\"right\" length=\"10\">Value</text>\r\n        </line>      \r\n        <line>\r\n             <text>------------------------------------------</text>\r\n        </line>   \r\n        #foreach ($ticketline in $ticket.getLines())\r\n        <line>\r\n            #if ($ticketline.isProductCom()) \r\n                <text align =\"left\" length=\"17\">*${ticketline.printName()}</text>\r\n            #else\r\n                <text align =\"left\" length=\"17\">${ticketline.printName()}</text>\r\n            #end\r\n            <text align =\"right\" length=\"10\">${ticketline.printPrice()}</text>\r\n            <text align =\"right\" length=\"5\">x${ticketline.printMultiply()}</text>\r\n            <text align =\"right\" length=\"10\">${ticketline.printSubValue()}</text>\r\n        </line> \r\n        #if ($ticketline.productAttSetInstId)\r\n        <line>\r\n	        <text align =\"left\" length=\"42\">    ${ticketline.productAttSetInstDesc}</text>\r\n        </line>\r\n        #end\r\n        #end\r\n        <line>\r\n             <text>------------------------------------------</text>\r\n        </line>   \r\n        <line>\r\n            <text>Items count: </text>\r\n            <text align =\"right\" length=\"10\">${ticket.printArticlesCount()}</text>\r\n        </line> \r\n        <line></line> \r\n	#foreach ($taxinfo in $taxes)  \r\n	#set( $taxline = $ticket.getTaxLine($taxinfo))\r\n	<line>  \r\n	<text align =\"left\" length=\"18\">${taxline.getTaxInfo()}</text>  \r\n	<text align =\"right\" length=\"12\">${taxline.printSubTotal()}</text> \r\n	<text align =\"right\" length=\"12\">${taxline.printTax()}</text> \r\n	</line>  \r\n	#end \r\n	<line> </line> \r\n        <line>\r\n            <text align =\"left\" length=\"16\">Subtotal.</text>\r\n            <text align =\"right\" length=\"20\">${ticket.printSubTotal()}</text>\r\n        </line> \r\n        <line>\r\n            <text align =\"left\" length=\"16\">Taxes.</text>\r\n            <text align =\"right\" length=\"20\">${ticket.printTax()}</text>\r\n        </line> \r\n        <line></line> \r\n        <line size=\"1\">\r\n            <text align =\"left\" length=\"16\" bold=\"true\">Total.</text>\r\n            <text align =\"right\" length=\"20\" bold=\"true\">${ticket.printTotal()}</text>\r\n        </line>    \r\n        #foreach ($paymentline in $ticket.payments)      \r\n         #if ($paymentline.name == \"cash\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Cash</text>\r\n        </line>  \r\n        <line>\r\n             <text align=\"left\" length=\"22\">Tendered:</text>\r\n             <text align =\"right\" length=\"20\">${paymentline.printPaid()}</text>\r\n         </line>  \r\n        <line>\r\n            <text align=\"left\" length=\"22\">Change:</text>\r\n            <text align =\"right\" length=\"20\">${paymentline.printChange()}</text>\r\n        </line>   \r\n         #end\r\n         #if ($paymentline.name == \"cashrefund\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Refund</text>\r\n         </line>\r\n        <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n         #end\r\n         #if ($paymentline.name == \"magcard\")\r\n        <line></line>        \r\n        <line>\r\n            <text bold=\"true\">Mag card</text>\r\n        </line>   \r\n         <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n        <line>\r\n            <text align =\"left\" length=\"22\">Number:</text>\r\n            <text>${paymentline.printCardNumber()}</text>\r\n        </line>\r\n        <line>\r\n            <text align =\"left\" length=\"22\">Expiration date:</text>\r\n            <text>${paymentline.printExpirationDate()}</text>\r\n        </line>\r\n        <line>\r\n            <text align =\"left\" length=\"22\">Operation:</text>\r\n            <text>${paymentline.printTransactionID()}</text>\r\n        </line>\r\n        <line>\r\n            <text align =\"left\" length=\"22\">Authorization:</text>\r\n            <text>${paymentline.printAuthorization()}</text>\r\n        </line>\r\n         #end  \r\n         #if ($paymentline.name == \"magcardrefund\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Mag card refund</text>\r\n        </line>    \r\n        <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n         #end\r\n         #if ($paymentline.name == \"cheque\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Cheque</text>\r\n        </line>    \r\n        <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n         #end\r\n         #if ($paymentline.name == \"chequerefund\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Cheque refund</text>\r\n        </line>    \r\n        <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n         #end\r\n         #if ($paymentline.name == \"paperin\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Note</text>\r\n        </line>    \r\n        <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n         #end\r\n         #if ($paymentline.name == \"paperout\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Note Refund</text>\r\n        </line>    \r\n        <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n         #end\r\n         #if ($paymentline.name == \"free\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Free</text>\r\n        </line>    \r\n        <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n         #end\r\n         #if ($paymentline.name == \"debt\")\r\n        <line></line>     \r\n        <line>\r\n            <text bold=\"true\">Debt</text>\r\n        </line>    \r\n        <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n        </line>    \r\n         #end \r\n         #end \r\n        <line></line>\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Cashier:</text>\r\n            <text>${ticket.printUser()}</text>\r\n        </line> \r\n        <line></line>            \r\n        <line>\r\n            <text align=\"center\" length=\"42\">Thank you for your visit.</text>\r\n        </line>   \r\n    </ticket>\r\n    #foreach ($paymentline in $ticket.payments)      \r\n     #if ($paymentline.name == \"cash\")\r\n    <opendrawer/>\r\n     #end\r\n     #if ($paymentline.name == \"cashrefund\")\r\n    <opendrawer/>\r\n     #end  \r\n    #end\r\n</output>'),('10','Window.Title',0,'Openbravo POS is a point of sale designed for touch screens.'),('11','Ticket.Buttons',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<configuration>\n    <button key=\"button.print\" titlekey=\"button.print\" template=\"Printer.TicketPreview\"/>\n    <button key=\"button.opendrawer\" titlekey=\"button.opendrawer\" template=\"Printer.OpenDrawer\"/>\n    <!-- <event key=\"ticket.change\" code=\"event.change\"/> -->\n    <!-- <event key=\"ticket.addline\" code=\"event.addline\"/> -->\n    <!-- <event key=\"ticket.removeline\" code=\"event.removeline\"/> -->\n    <!-- <event key=\"ticket.setline\" code=\"event.setline\"/> -->\n    <!-- <event key=\"ticket.show\" code=\"event.show\"/> -->\n    <!-- <event key=\"ticket.total\" code=\"event.total\"/> -->\n    <!-- <event key=\"ticket.close\" code=\"event.close\"/> -->   \n    <img-width value=\"64\"/>\n    <img-height value=\"54\"/>\n    <cat-height value=\"300\" />\n    <taxesincluded value=\"false\"/>   \n    <!-- <printselected value=\"true\"/> -->    \n    <!-- <taxcategoryid value=\"001\"/> -->\n    <!-- <pricevisible value=\"true\" /> -->\n</configuration>\n'),('12','Ticket.Line',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2007-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<line>\n    <column name=\"label.item\" width=\"125\" align=\"left\" value=\"&lt;html&gt;#if ($ticketline.isProductCom()) &lt;i&gt;*&amp;nbsp;&amp;nbsp;${ticketline.printName()}&lt;/i&gt; #else ${ticketline.printName()} #end&lt;br&gt;${ticketline.getProductAttSetInstDesc()}\"/>\n    <column name=\"label.price\" width=\"80\" align=\"right\" value=\"${ticketline.printPrice()}\"/>\n    <column name=\"label.units\" width=\"50\" align=\"right\" value=\"x${ticketline.printMultiply()}\"/>\n    <column name=\"label.tax\" width=\"100\" align=\"right\" value=\"${ticketline.printTaxRate()}\"/>\n    <column name=\"label.value\" width=\"80\" align=\"right\" value=\"${ticketline.printSubValue()}\"/>\n</line>'),('13','Printer.Inventory',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<output>\n    <ticket>\n        <image>Printer.Ticket.Logo</image>\n        <line></line>\n        <line>\n            <text align=\"center\" length=\"42\">Receipt sample.</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"42\">You can change this template</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"42\">in the resources panel</text>\n        </line>\n        <line></line>\n        <line>\n            <text>Date:     ${inventoryrecord.printDate()}</text>\n        </line>\n        <line>\n            <text>Reason:   ${inventoryrecord.printReason()}</text>\n        </line>\n        <line>\n            <text>Location: ${inventoryrecord.printLocation()}</text>\n        </line>\n        <line size=\"1\">\n            #if ($inventoryrecord.isInput())\n            <text align =\"center\" length=\"42\">In</text>\n            #else\n            <text align =\"center\" length=\"42\">Out</text>\n            #end\n        </line>\n        <line></line>    \n        <line>\n            <text align =\"left\" length=\"17\">Item</text>\n            <text align =\"right\" length=\"10\">Price</text>\n            <text align =\"right\" length=\"5\"></text>\n            <text align =\"right\" length=\"10\">Value</text>\n        </line>      \n        <line>\n            <text>------------------------------------------</text>\n        </line>   \n        #foreach ($inventoryline in $inventoryrecord.getLines())\n        <line>\n            <text align =\"left\" length=\"17\">${inventoryline.printName()}</text>\n            <text align =\"right\" length=\"10\">${inventoryline.printPrice()}</text>\n            <text align =\"right\" length=\"5\">x${inventoryline.printMultiply()}</text>\n            <text align =\"right\" length=\"10\">${inventoryline.printSubValue()}</text>\n        </line> \n        #if ($inventoryline.productAttSetInstId)\n        <line>\n	        <text align =\"left\" length=\"42\">    ${inventoryline.productAttSetInstDesc}</text>\n        </line>\n        #end\n        #end\n        <line>\n            <text>------------------------------------------</text>\n        </line>   \n        <line></line>            \n        <line>\n            <text align=\"center\" length=\"42\">Thank you for your visit.</text>\n        </line>   \n    </ticket>\n</output>'),('14','Menu.Root',0,'//    Openbravo POS is a point of sales application designed for touch screens.\n//    Copyright (C) 2007-2009 Openbravo, S.L.\n//    http://sourceforge.net/projects/openbravopos\n//\n//    This file is part of Openbravo POS.\n//\n//    Openbravo POS is free software: you can redistribute it and/or modify\n//    it under the terms of the GNU General Public License as published by\n//    the Free Software Foundation, either version 3 of the License, or\n//    (at your option) any later version.\n//\n//    Openbravo POS is distributed in the hope that it will be useful,\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n//    GNU General Public License for more details.\n//\n//    You should have received a copy of the GNU General Public License\n//    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n\n    group = menu.addGroup(\"Menu.Main\");\n    group.addPanel(\"/com/openbravo/images/mycomputer.png\", \"Menu.Ticket\", \"com.openbravo.pos.sales.JPanelTicketSales\");\n    group.addPanel(\"/com/openbravo/images/mycomputer.png\", \"Menu.TicketEdit\", \"com.openbravo.pos.sales.JPanelTicketEdits\");\n    group.addPanel(\"/com/openbravo/images/kdmconfig.png\", \"Menu.CustomersPayment\", \"com.o